import { ActionTypes } from '../types/action.types';

const initialState = {
    products: [
        {
            id: 1,
            title: "Shirt",
            category: "clothes",
            price: 40,
            img: "https://images.unsplash.com/photo-1521572163474-6864f9cf17ab?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=880&q=80"
        }
    ]
};

export const productReducer = (state = initialState, { type, payload }) => {

    switch (type) {
        case ActionTypes.SET_PRODUCTS:
            return state

        default:
            return state;
    }
}
